import React from 'react'

function NameList() {
    const name_list = ['Noyon', 'Tithi', 'Nihan']
    const name_map = name_list.map(n => <h3>{n}</h3>)
    return (
        <div>
            {
            name_list.map(name => <h3>{name}</h3>)
            }
            <div>{name_map}</div>
        </div>
    )
}

export default NameList
